import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import './index.css';
import { Layout, Menu, Breadcrumb } from 'antd';
import { Button } from 'antd';
import { Row, Col } from 'antd';
import { Avatar, Image } from 'antd';
import { Badge, Space, Switch } from 'antd';
import {
    DesktopOutlined,
    PieChartOutlined,
    FileOutlined,
    TeamOutlined,
    UserOutlined,
} from '@ant-design/icons';

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;
function App() {
  return (
      <Layout >
          <Header style={{color:"white", justifyContent: 'center'}}>
              <Row style={{ display: 'inline-flex', justifyContent: 'center'}}>
                  <Col>
                      <Avatar size={40}>USER</Avatar>
                  </Col>
                  <Col>
                      Tobi pizda
                  </Col>
              </Row>
          </Header>
          <Layout >
              <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
                  <Menu.Item key="1" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      <Badge count={25} />
                      BTC
                      <Badge count={100} style={{ verticalAlign: "center",  backgroundColor: '#52c41a' }}/>
                  </Menu.Item>
                  <Menu.Item key="2" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Ripple
                  </Menu.Item>
                  <Menu.Item key="3" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Eth
                  </Menu.Item>
                  <Menu.Item key="4" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Azaza
                  </Menu.Item>
              </Menu>
          </Layout>
          <Layout>
              <Row style={{ display: 'inline-flex', justifyContent: 'center'}}>
                  <Col>
                      <Button>Up</Button>
                  </Col>
                  <Col>
                      <Button>Down</Button>
                  </Col>
              </Row>

          </Layout>
          <Footer style={{ display: 'inline-flex', justifyContent: 'center'}}>
              Tobi Pizda
          </Footer>
      </Layout>
  );
}

export default App;
